import React from 'react';

import Terminal from 'react-console-emulator';

const commands = {
  echo: {
    description: 'Echo a passed string.',
    usage: 'echo <string>',
    fn() {
      // eslint-disable-next-line prefer-rest-params
      return `${Array.from(arguments).join(' ')}`;
    },
  },
  about: {
    name: 'about',
    description: 'about me and this place',
    func: function () {
      plainterm.type(
        "Hi. I'm Mikhail. I'm a front-end engineer. This is my home page. By default you won't be greeted with a logotype, fancy design or a catchy title. If you need something, you can directly ask for the information you need, the good ol CLI way. This entire website is under 30 kb (under 15 gzipped). Whoa!",
        16
      );
    },
  },
};

const MyTerminal = () => {
  return (
    <Terminal
      commands={commands}
      welcomeMessage="Welcome to the React terminal!"
      promptLabel="me@React:~$"
    />
  );
};
export default MyTerminal;
